async function fetchEdits(){

  var jsonUrl;
  if (document.domain === "localhost"){
    jsonUrl = '/assets/js/edits.json'
  } else {
    jsonUrl = '/assets/js/edits.json?cachebreak='//+Math.random()
  }

  const pageLocation = document.location.pathname + document.location.search;
  
  const response = await fetch(jsonUrl);
  edits = await response.json();

  if (edits[pageLocation]){
    for (let e in edits[pageLocation]){
      let $target = $('.' + e);
      let newContent = decodeURI(atob(edits[pageLocation][e].b64));
      // $target.html(filterXSS(newContent, XSSoptions)); /* removed XSS protection because it stripped headings html ids */  
      $target.html(newContent);
    }
  }
  editorModeOn()? 0: $(document).ready(fetchInlines);
  editorModeOn()? 0: $(document).ready(videoEmbeds);

  // really shouldn't be nested in here halfway through the actual execution chain, but... *todo* 
  if (typeof afterDispatch !== 'undefined') { afterDispatch() }

}

$(document).ready(fetchEdits);

function loadSearch(){
    $.getScript('/assets/js/simple-jekyll-search.min.js', function(){
      var sjs = SimpleJekyllSearch({
        searchInput: document.getElementById('search-input'),
        resultsContainer: document.getElementById('results-container'),
        json: '/assets/js/entities.json?v1'
      })
    })
}

$(document).ready(loadSearch);


async function fetchInlines(){  
  const response = await fetch('/assets/js/entities.json?v1');
    const entries = await response.json();
    var inlinesLookup = {};
    for (let i=0; i < entries.length; i++) {
        if (entries[i].inline){
            inlinesLookup[document.location.origin+entries[i].url] = entries[i].inline;
        }
    }

    var contentLinks = document.querySelectorAll('section p a, section ul a, section table a');
    const ignore = document.querySelectorAll('.no-inline a');
    const difference = (a, b) => a.filter(elt => b.indexOf(elt) === -1);
    contentLinks = difference([...contentLinks], [...ignore]);

    for (let i=0; i < contentLinks.length; i++){
        if ( inlinesLookup[contentLinks[i].href] ) { 
            contentLinks[i].innerHTML = inlinesLookup[contentLinks[i].href]
        }
    }

}
//$(document).ready(fetchInlines);

function videoEmbeds(){  
    const videoTemplate = `<video controls style="max-width:100%; width:400px">
    <source src="_url_">
    <a href="_url_">Sorry, your browser doesn't support embedded videos. Click here to download</a>
</video>`;
    var links = document.querySelectorAll('section p a, section ul a');

    for (let i=0; i < links.length; i++){
        if ( links[i].innerText.startsWith('video') ) {
            var url = links[i].href;
            links[i].outerHTML =  videoTemplate.replaceAll('_url_', url);
        }
    }
}

